import "./Test.css"

function Test() {
  const [test, setTest] = useState(false)

  return (
    <div>
     {test && <div className='front'></div> }
      <div className='back' onClick={() => setTest(true)}></div> 
      <button>Show Modal</button>
    </div>
  )
}
export default Test
